// Solutions.js
import React from 'react';
import './Solutions.css';

const Solutions = () => {
  return (
    <div>
      <Header />
        <div className="solutions">
          <nav className="navigation">
            <a href="#car-charger">Car Charger</a>
            <a href="#bus-charger">Bus Charger</a>
            <a href="#truck-charger">Truck Charger</a>
          </nav>
          <section id="car-charger" className="charger-section">
            <h2>Car Charger Section</h2>
            {/* Add content for the Car Charger section */}
          </section>
          <section id="bus-charger" className="charger-section">
            <h2>Bus Charger Section</h2>
            {/* Add content for the Bus Charger section */}
          </section>
          <section id="truck-charger" className="charger-section">
            <h2>Truck Charger Section</h2>
            {/* Add content for the Truck Charger section */}
          </section>
        </div>
    </div>

  );
};

export default Solutions;
